string2=""

total=0

def recuperar(s,n):
    valor=int(s[:n],2)
    s=s[n:]
    return s,valor
    
    
def unpack(string):
    
    global total
    
    string,v=recuperar(string,3)
    
    total+=v
        
    string,t = recuperar(string,3)
    
    if t==4:
        
        valorB=""
        primero=5
        
        while primero!="0":
            
            parte=string[:5]
            string,_=recuperar(string,5)
            primero=parte[0]
            valorB+=parte[1:5]
            
        valor=int(valorB,2)
        
        return valor, string
    
    else:
        
        i=string[0]
        
        valores=[]
        
        string=string[1:]
        
        if i=="0":
            string,bits=recuperar(string,15)
            sub=string[:bits]
            string,_=recuperar(string,bits)
                
            while sub:
                valor,sub=unpack(sub)
                valores.append(valor)

            
        else:
            string,pak=recuperar(string,11)

            for n in range (pak):
                valor,string=unpack(string)
                valores.append(valor)
                
    #print(valores)
    
    regreso=1
    
    if t==0:
        regreso=sum(valores)
        
    if t==1:
        for x in valores:
            regreso*=x
            
    if t==2:
        regreso=min(valores)
        
    if t==3:
        regreso =max(valores)
    if t==5:
        if not valores[0]>valores[1]:
            regreso=0
        
    if t==6:
        if not valores[0]<valores[1]:
            regreso=0
        
    if t==7:
        if not valores[0]==valores[1]:
            regreso=0
    
    return regreso,string
        
        
               
